import React from "react";
import { Route, Routes, Link, BrowerRouter as Router } from "react-router-dom";
import Home from "./Home";

const AppRoutes = () => {
    return (
        <div>
            <Router>
                <Routes>
                    <Route path="./">{Home}</Route>
                </Routes>
            </Router>
        </div>
    );
};

export default AppRoutes;
